('da', '_template', 'atutor_accessibility_text', '<p>ATutor har en rÃ¦kke egenskaber og funktioner, der skal sikre at kursernes indhold er tilgÃ¦ngeligt for alle brugere - ogsÃ¥ for brugere med en langsom internetforbindelse eller Ã¦ldre browsere. Der er taget sÃ¦rlige hensyn til brugere, der pÃ¥ grund af funktionsnedsÃ¦ttelser anvender specialudstyr og hjÃ¦lpemidler til navigering pÃ¥ websider. Disse specialfunktioner er nÃ¦rmere beskrevet herunder. Alt efter hvilken skabelon, der er valgt, kan alle eller kun udvalgte af disse specialfunktioner vÃ¦re tilgÃ¦ngelige. Standardskabelonen giver adgang til alle specialfunktioner.</p> <ol> <li><strong>Overspring henvisninger:</strong> I Ã¸verste venstre hjÃ¸rne af ATutor er der et skjult link, der gÃ¸r det muligt for brugere af sÃ¦rlige tekniske hjÃ¦lpemidler at hoppe forbi navigationspunkterne og gÃ¥ direkte til et mÃ¦rke Ã¸verst i det kursusindhold, der bliver vist. Tryk tabulatorknappen en enkelt gang efter at siden er fÃ¦rdigdannet og spring frem til  det fÃ¸rste ankermÃ¦rke. Tryk derefter pÃ¥ retur-tasten for at flytte kursusindholdet Ã¸verst op pÃ¥ siden. Der kan ogsÃ¥ springes til fÃ¸rste ankermÃ¦rke med genvejstasten [Alt-c]. Derved kan der springes til stasrten pÃ¥ sidens indhold ligegyldigt hvor pÃ¥ siden, curseren er placeret. <br /><br /> \r\nDer er andre overspringsmuligheder: Â”Spring forbi tabelÂ” gÃ¸r det muligt for brugeren at springe over det indhold, der mÃ¥tte vÃ¦re i en tabel, for hurtigt at nÃ¥ frem til de oplysninger, der mÃ¥tte vÃ¦re under tabellen. Â”Spring forbi koderÂ” gÃ¸r det pÃ¥ samme mÃ¥de muligt at springe forbi smilies og andre koder, der mÃ¥tte vÃ¦re i bunden af et indlÃ¦g i et DebatForum. <br /><br /></li><li><strong>Genvejstaster :</strong> Der er knyttet tastaturgenveje til mange af ATutors funktioner. Tryk alt-tasten pÃ¥ samme tid som det anfÃ¸rte tal, bogstav eller tegn for at bruge genvejen. Der bliver automatisk knyttet genvejstaster til fanebladene i hovedmenuen. Det fÃ¸rste faneblad knyttes til [Alt-1], det andet faneblad til [Alt-2] og sÃ¥ fremdeles. BemÃ¦rk at ikke alle browsere stÃ¸tter brugen af genvejstaster!<br /><br /> Genvejstaster til navigering<ul> <li>[Alt-1 til Alt-0] Hovedmenuens faneblade</li> <li>[Alt-,] ForegÃ¥ende emne (dvs. venstre piletegn <)</li> <li>[Alt-.] NÃ¦ste emne (dvs. hÃ¸jre piletegn > )</li> <li>[Alt-.] Tilbage (dvs. hÃ¸jre piletegn > ved aktiviteter uden for kursusindholdet )</li> <li>[Alt-j] Oversspringsmenu</li> <li>[Alt s] Send (findes pÃ¥ sider med en formular)</li> <li>[Alt c] Spring til Ã¸verste del af kursusindholdet</li> </ul> Genvejstaster til indholdseditor <ul> <li>[Alt n] Fanebladet Indhold </li> <li>[Alt p] Fanebladet Egenskaber </li> <li>[Alt g] Fanebladet Ordliste </li> <li>[Alt r] Fanebladet ForhÃ¥ndsvisning </li> <li>[Alt a] Fanebladet TilgÃ¦ngelighed </li> <li>[Alt-s] Gem</li> </ul> Genvejstaster til Chat<ul>    <li>[Alt c] Spring til feltet Skriv Besked </li> <li>[Alt r] Opdater beskedoversigt</li> <li>[Alt m] Spring til beskedoversigten </li> <li>[Alt q] Ã…ben Chat hjÃ¦lpen </li> </ul> Genvejstaster til indbakken <ul> <li>[Alt-r] Svar pÃ¥ breve</li> </ul> Genvejstaster til HTML-editor <ul> <li>[Alt-q] Spring til bundlinien </li> <li>[Alt-z] Spring til editorens indholdsomrÃ¥de </li> <li>[Alt-x] Spring til elementoversigten i bunden </li> </ul> </li><br /> <li><strong>Kontrol af tilgÃ¦ngelighed :</strong> Ved redigering af kursusindhold  kan underviserne kontrollere tilgÃ¦ngeligheden af det indhold de laver for at sikre, at indholdet vil vÃ¦re tilgÃ¦ngeligt for alle brugere inklusive dem, der bruger sÃ¦rlige tekniske hjÃ¦lpemidler eller Ã¦ldre udstyr. Brug [Alt-a] til at kontrollere tilgÃ¦ngeligheden ved redigering af kursusindhold. </li><br /> <li><strong>Alternativ tekst :</strong> Alle billeder af betydning for forstÃ¥elsen er i ATutor  forsynet med en alternativ tekst, der beskriver billedet og dets funktion. De billeder, der ikke er af betydning for forstÃ¥elsen af kursusindholdet, har ikke en alternativ tekst tilknyttet og bliver derfor ignoreret af oplÃ¦sningsprogrammer.</li><br /><li><strong>Alternativ navigation:</strong> VÃ¦rktÃ¸jer til  global, hierakisk og lineÃ¦r navigation er tilgÃ¦ngelige i ATutor. Brugeren har sÃ¥ledes mulighed for at arbejde med kursusindholdet og strukturere sit arbejde pÃ¥ de mÃ¥der, der passer til den enkeltes foretrukne lÃ¦ringsstile. Atutors Indholdsoversigt viser alle indholdsdele og sider foruden alle vÃ¦rktÃ¸jer og hjÃ¦lpefunktioner. Fra Indholdsoversigten er der sÃ¥ledes adgang til alle dele af et kursus.</li><br /><li><strong>BogmÃ¦rke/FortsÃ¦t: </strong>Hvis en bruger forlader kursusindholdet for f.eks. at deltage i DebatForum, husker ATutor den indholdsside, der blev forladt. Brugeren kan sÃ¥ledes hurtigt vende tilbage til den senest besÃ¸gte side i kursusindholdet. Den senest besÃ¸gte side i kursusindholdet bliver ogsÃ¥ husket mellem to kursusbesÃ¸g. Ved genoptagelse af kurset kan brugeren klikke \'BogmÃ¦rke\' ved kurset i oversigten \'Mine kurser\' Â– eller klikke bogmÃ¦rkesymbolet Ã¸verst pÃ¥ siden, nÃ¥r kurset er valgt. Genvejstasten [Alt-.] kan ogsÃ¥ fÃ¸re brugeren tilbage til den senest besÃ¸gte indholdsside. </li> <br /><li><strong>Skjul / vis side sidemenu :</strong>Brugere med  Ã¦ldre udgaver af hjÃ¦lpemidler til skÃ¦rmlÃ¦sning, der ikke kan lÃ¦se tekst anbragt i spalter, kan vÃ¦lge at   skjule ATutors sidemenuer og se indholdet pÃ¥ linier i stedet for i kolonner. Det giver desuden mere plads pÃ¥ skÃ¦rmen for brugere med smÃ¥ skÃ¦rme.</li> <br /><li><strong>SÃ¸g og sortÃ©r :</strong> Der er sÃ¸ge- / filtreringsmuligheder ved de fleste lister og oversigter for at reducere den mÃ¦ngde af oplysninger, der vises.   De fleste lister og oversigter kan ogsÃ¥ sorteres ved at klikke pÃ¥ kolonnetitlen Ã¸verst i oversigten for at fremme overskueligheden. </li><br /> <li><strong>Betegnelser i tabeloverskrifter : </strong>Alle lister og oversigter prÃ¦senteret i tabeller er i den bagvedliggende kode forsynet med  alternative tekster for at sikre, at brugere med skÃ¦rmlÃ¦sere kan navigere i tabellerne uden at blive i tvivl om, hvilke oplysninger, der ligger i de enkelte celler i tabellen. </li><br /> <li><strong>Tekst i formularer :</strong> Alle felter i formularerne rundt om i ATutor er i den bagvedliggende kode afmÃ¦rket med LABEL-elementet for at sikre, at de bliver tilgÃ¦ngelige for brugere med hjÃ¦lpemidler til skÃ¦rmlÃ¦sning. Den konsekvente afmÃ¦rkning pÃ¥ denne mÃ¥de gÃ¸r det ogsÃ¥ muligt blot at klikke pÃ¥ teksten til et formularfelt for at gÃ¸re feltet aktivt. Det gÃ¸r det nemmere at bruge musen til at vÃ¦lge og afmÃ¦rke i  f.eks. en checkbox Â– til gavn for de brugere, der har svÃ¦rt ved at styre musen og ramme nÃ¸jagtigt pÃ¥ et ganske lille skÃ¦rmomrÃ¥de. </li> <br /><li><strong>Style Sheets :</strong> Overalt hvor det har vÃ¦ret muligt er ATutors fremtrÃ¦den og opsÃ¦tning styret af style sheets elementer. Det gÃ¸r det muligt for  brugerne forholdsvis nemt at Ã¦ndre pÃ¥ ATutors oprindelige udseende og fremtrÃ¦den og selv vÃ¦lge f.eks. andre fontstÃ¸rrelser, farver og lignende.</li> <br /><li><strong>Fokus pÃ¥ formularfeltet :</strong> PÃ¥ de sider, hvor en formular er det centrale indhold, vil curseren automatisk blive placeret i det fÃ¸rste felt efter at siden er dannet helt pÃ¥ skÃ¦rmen. Det er sÃ¥ledes ikke nÃ¸dvendig at klikke eller at skulle bruge tabulatoren for at finde frem til feltet og aktivere det. Brugeren kan begynde at skrive tekst ind i feltet i samme Ã¸jeblik, siden er fÃ¦rdigdannet. Brugeren kan vÃ¦lge at slÃ¥ fokus pÃ¥ formularfeltet fra, hvis det er generende for skÃ¦rmlÃ¦seren eller for andre anvendte hjÃ¦lpemedler. </li> <br /><li><strong>Ã†ndring af billedstÃ¸rrelse : </strong>Med en browser, der understÃ¸tter Ã¦ndring af billedstÃ¸rrelse kan ATutors ikoner forstÃ¸rres til gavn for brugere med synsnedsÃ¦ttelse. (f.eks. Netscape 7 : Tryk Alt +) . Overalt, hvor det har vÃ¦ret muligt, opretholdes forholdet mellem en sides enkelte elementer. Dvs. hvis et af sidens elementer forstÃ¸rres eller formindskes, vil de Ã¸vrige elementer pÃ¥ siden Ã¦ndres tilsvarende, sÃ¥ skÃ¦rmbilledets opbygning fastholdes. </li> </ol>', '2006-11-27 15:42:57', ''),
